import { Card, Grid } from 'semantic-ui-react';
import DoctorCard from '../components/DoctorCard';
import Axios from 'axios';

import React, { Component } from 'react';
const index = [];

export default class SearchIndex extends Component {
  loadSearchIndex = async () => {
    const { searchId, userId } = this.props.match.params
    let csv = '';
    try {
      let res = await Axios.get(`http://localhost:3000/searches/${searchId}`);
      csv = res.data.csv;
    } catch (err) {}
    csv = csv.split(',');
    csv.pop();
    console.log(csv, 'CSV FROM LOADSEARCHINDEX');
    await csv.map(async (id) => {
      // console.log(id);
      let doctorId = parseInt(id);
      let res = await Axios.get(`http://localhost:3000/doctors/${doctorId}`);
      let doc = res.data;

      // console.log(doc);
      index.push(doc);
      // console.log(index);
    });

    // debugger
  };

  displayDoctors = () => {

    return index.map((doc) => (
      <DoctorCard key={doc.id}>{doc.name}</DoctorCard>
    ));
  };

  async componentDidMount() {
    this.loadSearchIndex()

  }
  render() {
    const searchId = parseInt(this.props.match.params.searchId)
    const searches = this.props.currentUser.searches

  }
}
